import React from "react";
import {
  BrowserRouter as Router,
  Route,
  NavLink,
  Routes,
  useHistory,
} from "react-router-dom";

import { CustomErrorState } from "../guides/CustomErrorState";
import { CustomLoadingState } from "../guides/CustomLoadingState";
import { CustomEmptyState } from "../guides/CustomEmptyState";

const Home = () => {
  return (
    <Router>
      <React.Fragment>
        <NavLink to="/" className="nav-link">
          Loading
        </NavLink>
        <NavLink to="/empty" className="nav-link">
          Empty
        </NavLink>
        <NavLink to="/error" className="nav-link">
          Error
        </NavLink>

        <Routes>
          <Route exact path="/">
            element={<CustomLoadingState />}
          </Route>

          <Route exact path="/empty">
            element={<CustomEmptyState />}
          </Route>

          <Route exact path="/error">
            element={<CustomErrorState />}
          </Route>
        </Routes>
      </React.Fragment>
    </Router>
  );
};

export { Home };
